    true,nt"url": null,nt"notes": "<p>The Panel Study of Income Dynamics (PSID)
    began in 1968 with a nationally representative sample of over 18,000 individuals
    living in 5,000 families in the United States. Information on these individuals
    and their descendants has been collected continuously, including data covering employment,
    income, wealth, expenditures, health, marriage, childbearing, child development,
    philanthropy, education, and numerous other topics.</p>n",nt"license_title":
